// src/components/Sidebar.js
import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar">
      {/* Example server icons / user icons */}
      <div className="serverIcon" title="Home"></div>
      <div className="serverIcon" title="Games"></div>
      <div className="serverIcon" title="Friends"></div>

      {/* Add more icons or a user avatar at bottom... */}
      <div style={{ flex: 1 }}></div>
      <div className="serverIcon" title="User Profile"></div>
    </div>
  );
}

export default Sidebar;
